import '../CSSContents/Profile.css';


import LoginRegister from './LoginRegister';



function Profile() {

    const isLoggedIn = JSON.parse(localStorage.getItem('isLoggedIn'));

    if (!isLoggedIn) {
        return <LoginRegister />

    }

    return (
        <div className='Profile'>

            <div>
                New content here

            </div>


        </div>


    )


}


export default Profile;
